// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './AuthContext';
import PrivateRoute from './PrivateRoute'; // If you've created this component

// Import your components
import WazuhActive from './components/wazuh_active';
import Home from './pages/Home';
import Agents from './pages/Agents';
import BackToTop from './components/scrollbutton';
import Login from './pages/Login';
import Register from './pages/Register';

function App() {
  return (
    <AuthProvider>
      <div className="App">
        <Router>
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            {/* Use PrivateRoute for authenticated routes */}
            <PrivateRoute path="/home" element={<Home />} />
            <PrivateRoute path="/wazuh-active" element={<WazuhActive />} />
            <PrivateRoute path="/agents" element={<Agents />} />
          </Routes>
          <BackToTop />
        </Router>
      </div>
    </AuthProvider>
  );
}

export default App;
